import './App.css';
import { ReactDOM } from 'react';
import NavbarButton from './components/NavbarButton';
import Presentation from './components/Presentation';
import AboutMe from './components/AboutMe';

function App() {
  return (
    <div className="App">
      <header>
        <div id='logo-container'>
          <button id='button-index' onClick={() => console.log('inicio')}>Dekkvar</button>
        </div>
        <div id='navbarButton-container'>
          <NavbarButton onClick={() => {aboutMeSection()}}>About me</NavbarButton>
          <NavbarButton onClick={() => console.log('My projects section')}>My projects</NavbarButton>
          <NavbarButton onClick={() => console.log('Contact me section')}>Contact me</NavbarButton>
        </div>
      </header>
      <div id='content-container'>
        <Presentation />
      </div>
    </div>
  );
}

const content = ReactDOM.createRoot(document.getElementById('content-container'));

function aboutMeSection() {
  content.render(<AboutMe />)
}


export default App;
